import './CategoryCourses.css';
import Course from './Course.js'

function CategoryCourses({title, courses}) {

    return(
        <section className='courses-container'>
            <div className='courses-container-title'>{title}</div>
            <div className='courses-container-courses'>
                {courses.list.map((item) => {
                    return <Course thumbnail={item.thumbnail} courseTitle={item.courseTitle} courseOwner={item.courseOwner} rating={item.rating} price={item.price} />}
                )}
            </div>
            
        </section>
    );
};

export default CategoryCourses;
